import React from 'react'
import { useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
function Header() {

  useEffect(()=>{
    const auth = localStorage.getItem('user');
    if(auth){
      useNavigate('/')
  }
})
  return (
    <div className='header'>
        <ul className='hList'>
            <li className='menu'><Link to = '/'>Home </Link></li>
            <li className='menu'><Link to = '/add'>Add</Link></li>
            <li className='menu'><Link to = '/update'>Update</Link></li>
            <li className='menu'><Link to = '/logout'>Logout</Link></li>
            <li className='menu'><Link to = '/profile'>Profile</Link></li>
            <li className='menu'><Link to= '/signup'>Sign UP</Link></li>
        </ul>
    </div>
  )
}

export default Header
